import "./App.css";
import Navbar from "./components/navbar.js";
import Services from "./pages/services.js";
import Footer from "./components/footer.js";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";

function App() {
  return (
    <Router>
      <div className="App">
      <Switch>
          <Route path="/about">
            <About />
          </Route>
          <Route path="/users">
            <Users />
          </Route>
          <Route path="/">
            <Home />
          </Route>
        </Switch>
        <Navbar />
        <Services />
        <Footer />
      </div>
    </Router>
  );
}

export default App;
